void GLViewNewModule::onKeyDown( const SDL_KeyboardEvent& key )
{
   GLView::onKeyDown( key );
   if( key.keysym.sym == SDLK_0 )
      this->setNumPhysicsStepsPerRender( 1 );

   if( key.keysym.sym == SDLK_w)
   {
       pressW = true;
   }
   if (key.keysym.sym == SDLK_a)
   {
       pressA = true;
   }
   if (key.keysym.sym == SDLK_s)
   {
       pressS = true;
   }
   if (key.keysym.sym == SDLK_d)
   {
       pressD = true; 
   }
   if (key.keysym.sym == SDLK_SPACE)
   {
       if (!pressSpace && boost >= 5 && theGUI->onGoing)
       {
            pressSpace = true;
            speed *= 2;
            boostSound = vehicleBoosting->play2D(boosting.c_str(), false, false, true);
            boostSound->setVolume(0.1);
       }
   }
   if (key.keysym.sym == SDLK_LSHIFT)
   {
       pressLshift = true;
   }
   if (key.keysym.sym == SDLK_LCTRL)
   {
       pressLctrl = true;
   }
   if (key.keysym.sym == SDLK_m)
   {
       auto curr = cam->getPosition();
       std::cout << curr.x << std::endl;
       std::cout << curr.y << std::endl;
       std::cout << curr.z << std::endl;
   }
}


void GLViewNewModule::onKeyUp( const SDL_KeyboardEvent& key )
{
   GLView::onKeyUp( key );

   if (key.keysym.sym == SDLK_w)
   {
       pressW = false;
   }
   if (key.keysym.sym == SDLK_a)
   {
       pressA = false;
   }
   if (key.keysym.sym == SDLK_s)
   {
       pressS = false;
   }
   if (key.keysym.sym == SDLK_d)
   {
       pressD = false;
   }
   if (key.keysym.sym == SDLK_SPACE)
   {
   }
   if (key.keysym.sym == SDLK_LSHIFT)
   {
       pressLshift = false;
   }
   if (key.keysym.sym == SDLK_LCTRL)
   {
       pressLctrl = false;
   }
}


